	<div class="main">
		<h1>Stagecraft brought him<br> singular happiness,</h1>
		<p>perhaps the first he had ever known, but once<br>the last line was spoken and the last corpse<br>carted off, a hateful taste of the unreal<br>came down on him. He was no longer Ferrex or<br>Tamburlaine but went back to being nobody.</p>
